import React from "react";
import {SignUpComponent} from "./SignUpComponent";

export class LogInComponent extends React.Component{
    render(){
        return(
            <>
                <div className="login_div">
                    <div className="login_radios">
                        <label><input type="radio" name="optradio"/>Sign In</label>
                        <label><input type="radio" name="optradio"/>Register</label>
                    </div>
                    <form className="login_form">
                        <div className="form-group">
                            <label htmlFor="inputEmail">Email</label>
                            <input type="text" title="Enter username or email" className="form-control" id="inputEmail"/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="inputPassword">Password</label>
                            <input type="password" className="form-control" id="inputPassword"></input>
                        </div>

                    </form>
                </div>

            </>
        )
    }



}
